import styled from "styled-components";

const Container = styled.div`
  font-family: "Lexend Deca";
  width: 100%;
  height: 100%;
  background-color: blueviolet;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

export { Container };
